import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button class="btn">Start</button>
        <p>
          Click button to start pomodoro!
        </p>

        <a
          className="App-link"
          href="https://github.com/EthanWolf714"
          target="_blank"
          rel="noopener noreferrer"
        >
          Link to Github
        </a>
      </header>
    </div>
  );
}

export default App;
